const SectionHeader = (props) => (
      <div className="items-center justify-center h-screen">
            <div class="container mx-auto flex my-auto items-center"> 
                <div class="flex flex-col w-full md:w-2/5 self-center justify-center items-start text-center md:text-left">
                    <p class="uppercase tracking-loose w-full text-base m-2">{props.smallTitle}</p>
                    <h1 class="my-4 font-bold leading-tight text-5xl m-2">{props.bigTitle}</h1>
                    <p class="leading-normal mb-8 text-lg m-2">
                        {props.description} 
                    </p>
                </div>
            </div>
        </div>
);

export default SectionHeader;
